package devutility.internal.test.service.data.codec.base64utils;

import java.io.IOException;

import devutility.internal.data.codec.Base64Utils;
import devutility.internal.test.BaseTest;
import devutility.internal.test.TestExecutor;

public class DecodeToImageTest extends BaseTest {
	private String file = "E:\\Test\\test.png";
	private String value = "data:image/jpeg;base64,";

	@Override
	public void run() {
		try {
			System.out.println(value.length());
			System.out.println(value.getBytes().length);
			Base64Utils.decodeToImage(file, value);
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

	public static void main(String[] args) {
		TestExecutor.run(DecodeToImageTest.class);
	}
}